import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPrescriptionBottle, faBroadcastTower, faCoffee, faDatabase } from '@fortawesome/fontawesome-free-solid'
import "./sidebar.css"
import { Button } from 'react-bootstrap';
import { useHistory } from 'react-router-dom';
 
const Sidebar = () => {
    const addDoctor = useHistory();
const handleAddDoctor =()=>{
  addDoctor.push('/addDoctor')
}
    return (
        <div>
         <FontAwesomeIcon icon={faPrescriptionBottle} />  <Button onClick={handleAddDoctor} style={{backgroundColor:"none"}}>Add doctor</Button> <br/><br/>
        <FontAwesomeIcon icon={faPrescriptionBottle} /> <Button>Appointment</Button><br/><br/>
        <FontAwesomeIcon icon={faDatabase} /> <Button>Dashboard</Button>
        </div>
    );
};

export default Sidebar;
